import React from 'react';

interface Todo {
    type:string;
    completed:boolean;
}

interface TodoList {
  todos: Todo[];
  onToggle: (item: Todo) => void;
  onDelete: (item: Todo) => void;
}

const ListDetail = ({ filteredData, SetTodoChange, onDelete }:TodoList) => {
  return (
    <div>
      {filteredData.map((item, i) => (
        <div key={i}>
          <input
            type="checkbox"
            checked={item.completed}
            onChange={() => onToggle(item)}
          />
          <span>{item.type}</span>
          <button onClick={() => onDelete(item)}>X</button>
        </div>
      ))}
    </div>
  );
};

export default ListDetail;
